import React from 'react';
import { graphql, Link } from 'gatsby';
import Img from 'gatsby-image';
import chunk from 'lodash/fp/chunk';
import circle from 'uswds_images/circle-124.png';
import Layout from '../components/layout';
import RegList from '../components/reglist'

const Index = ({ data }) => {
  const { callout, media, section, tagline } = data.dataYaml;
  return (
    <Layout>
      <section className="usa-hero">
      {/* <Img
          fluid={data.heroImage.childImageSharp.fluid}
          className="usa-hero__image"
          fadeIn={false}
        /> */}
        <img src="data:image/jpeg;base64," className="usa-hero__image" />
        <div className="grid-container">
          <div className="usa-hero__callout">
            <h2 className="usa-hero__heading">{callout.title}</h2>
            <p>{callout.text}</p>
            {/* <Link className="usa-button" to={callout.cta.link}>
              {callout.cta.text}
            </Link> */}
          </div>
        </div>
      </section>

      <section className="grid-container usa-section">
        <div className="grid-row grid-gap">
          <div className="tablet:grid-col-4">
            <h2 className="font-heading-xl margin-top-0 tablet:margin-bottom-0">{tagline.title}</h2>
          </div>
          <div className="tablet:grid-col-8 usa-prose">
            {tagline.content.map((p, idx) => (
              <p key={idx}>{p}</p>
            ))}
            <RegList />
          </div>
        </div>
      </section>

    </Layout>
  );
};

export const query = graphql`
  query IndexQuery {
    heroImage: file(base: { eq: "hero.png" }) {
      childImageSharp {
        fluid(maxWidth: 400) {
          ...GatsbyImageSharpFluid
        }
      }
    }
    dataYaml(page: { eq: "index" }) {
      callout {
        title
        text
        cta {
          text
          link
        }
      }
      tagline {
        title
        content
      }
    }
  }
`;

export default Index;
